import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {

    return(
        <div>
            <NavLink to="./Patient">
                <button type="button" className="btn btn-primary">Patient</button>
            </NavLink>

            <br />
            <NavLink to="./Home">Home</NavLink>
            <br />
            <NavLink to="./Clinician">Clinician</NavLink>
            
            <br></br>
        </div>
    );

};

export default Home;
